import { useState } from 'react';
import Banner from './components/Banner';
import Form from './components/Form';
import Team from './components/Team';

function App() {

  const Teams = [
    {
      name: 'Programação',
      primarycolor: '#57C278',
      secundarycolor:'D9F7E9'
    },
    {
      name: 'Front-End',
      primarycolor: '#82CFFA',
      secundarycolor:'#E8F8FF'
    },
    {
      name: 'Data Science',
      primarycolor: '#A6D157',
      secundarycolor:'#F0F8E2'
    },
    {
      name: 'Devops',
      primarycolor: '#E06B69',
      secundarycolor:'#FDE7E8'
    },
    {
      name: 'UX e Design',
      primarycolor: '#D86EBF',
      secundarycolor:'#FAE5F5'
    },
    {
      name: 'Mobile',
      primarycolor: '#FEBA05',
      secundarycolor:'#FFF5D9'
    },
    {
      name: 'Inovação e Gestão',
      primarycolor: '#FF8A29',
      secundarycolor:'#FFEEDF'
    },
  ]

  const [users, setUsers] = useState([])
  const toNewUserRegistered =(user) => {
    console.log(user)
    setUsers([...users, user])
  }

  return (
    <div className="App">
      <Banner />
      <Form toUserRegistered = {user => toNewUserRegistered(user)} />
      <Team name = "Programação"/>
      <Team name = "Front-End"/>
      <Team name = "Data-Science"/>
      <Team name = "Devops"/>
      <Team name = "UX e Design"/>
      <Team name = "Mobile"/>
      <Team name = "Inovação e Gestão"/>
    </div>
  );
}

export default App;
